int fuelToPost(string fuel){
  int result = 0;
  switch(fuel){
    case &quot;ДТ-З&quot;:
    case &quot;ДТЗ&quot;:
      result = 1;
      break;
    case &quot;ДТ-Л&quot;:
    case &quot;ДТЛ&quot;:
      result = 2;
      break;
    case &quot;92&quot;:
    case &quot;АИ 92&quot;:
      result = 3;
      break;
    case &quot;95&quot;:
    case &quot;АИ 95&quot;:
      result = 4;
      break;

  }
}

main(){
  string dp_usn = &quot;LAST_RECEIVE_&quot; + LINE + &quot;.init.&quot;;
  string fuel, rvs;

  int ac_usn = 0;
  dyn_int usns;
  dyn_string dps;
  for(int i=1; i&lt;=8; i++){
    anytype tmp;
    dpGet(dp_usn + i + &quot;.usn&quot;, tmp);
    if(tmp == i){
      ac_usn = i;
      usns.append(i);
      dps.append(&quot;USN_&quot; + i + &quot;.PST_&quot; + LINE + &quot;.STS&quot;);
      dps.append(&quot;USN_&quot; + i + &quot;.PST_&quot; + LINE + &quot;.PRS&quot;);
      dps.append(&quot;USN_&quot; + i + &quot;.PST_&quot; + LINE + &quot;.VLV&quot;);
      dps.append(&quot;USN_&quot; + i + &quot;.PST_&quot; + LINE + &quot;.OVR_STS&quot;);
    }
  }
  dpGet(dp_usn + ac_usn + &quot;.fuel&quot;, fuel,
        dp_usn + ac_usn + &quot;.tank&quot;, rvs);

  txt_rvs.text(rvs);
  txt_fuel.text(fuel);
}

